import React, { useContext, useEffect } from "react";
import { UsersContext } from "./apk";
import { Link } from "react-router-dom";

export default function Read({users}){
    const context = useContext(UsersContext);
    
    useEffect(() => {
        console.log("testing de context dd",context.usersd);
    }, [context]);
  return(
    <>
  
    <table class="table table-striped table-hover table-border mt-4 text-center" >
        <thead>
            <tr>
                <th scope="col">id</th>
                <th scope="col">fullname</th>
                <th scope="col">country</th>
            </tr>
        </thead>
        <tbody>
        {context.usersd? context.usersd.map((user,key)=>(
 <tr key={key}>
 <td scope="row">{user.id}</td>
 <td>{user.fullname}</td>
 <td>{user.country}</td>
 <td> <button type="submit" className="btn btn-primary" ><Link to={`/users/${user.id}/Update`} class="nav-link active">update</Link></button></td>
</tr>
        )):<h1 colspan="3">no users</h1>}
           
          
        </tbody>
    </table>
    </>
  )
};
